	add("indication", "{\"term\":\"indication\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\", \"old french (842-ca. 1400)\", \"Italian\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027indication\u0027 from Latin {{m|la|indicātiō||a showing, indicating the value of something; valuation}}, from {{m|la|indicō||point out, indicate, show; value}}; see indicate; confer French \u0027indication\u0027 Spanish \u0027indicación\u0027 Italian \u0027indicazione\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Act of pointing out or indicating\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"That which serves to indicate or point out; mark; token; sign; symptom; evidence\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The frequent stops they make in the most convenient places are plain \u0027\u0027indications\u0027\u0027 of their weariness. \u0027w:Joseph Joseph Addison\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Discovery made; information\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Explanation; display. \u0027w:Francis Francis Bacon\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Any symptom or occurrence in a disease, which serves to direct to suitable remedies\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An declared approximation of the price at which a traded security is likely to commence trading\", \"priority\":7}]}, \"synonyms\":{}}");

	add("indicium", "{\"term\":\"indicium\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027indicium\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An indication; a sign\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1969\u0027\u0027, Vladimir Nabokov, \u0027Ada or Ardor\u0027, Penguin 2011, p. 431\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"that dim continuum cannot be as sensually groped for, tasted, harkened to, as Veen\u0027s Hollow between rhythmic beats; but it shares with it one remarkable \u0027\u0027indicium\u0027\u0027: the immobility of perceptual Time\", \"priority\":3}]}, \"synonyms\":{}}");

	add("indiction", "{\"term\":\"indiction\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027indiction\u0027 or its source, Latin {{m|la|indictiōnem}}, accusative singular of {{m|la|indictiō}}, from \u0027indicere\u0027 present active infinitive of {{m|la|indicō}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fiscal period of fifteen years, instituted by Constantine in 313 (but counting from 1st September 312), used throughout the Middle Ages as a way of dating events, documents etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A declaration or official announcement\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The decree made by Roman Emperors which fixed the property tax for the next fifteen years\", \"priority\":3}]}, \"synonyms\":{}}");

