	add("indisposition", "{\"term\":\"indisposition\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|frm|indisposicion|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mild illness, the state of being indisposed\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1751,\u0027\u0027 Henry Fielding, \u0027Amelia\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I was scarce sooner recovered from my \u0027\u0027indisposition\u0027\u0027 than Amelia herself fell ill\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A state of not being disposed to do something; disinclination; unwillingness\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1989\u0027\u0027, Thomas Robert Malthus, ‎John Pullen, \u0027Principles of Political Economy\u0027 (volume 2, page 435\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"He argued that the progress of wealth could be impeded not only by an \u0027\u0027indisposition\u0027\u0027 to produce, but also by an indisposition to consume\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A bad mood or disposition\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1597,\u0027\u0027 Francis Bacon, \u0027Essays\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Doth any man doubt, that if there were taken out of men\u0027s minds, vain opinions, flattering hopes, false valuations, imaginations as one would, and the like, but it would leave the minds, of a number of men, poor shrunken things, full of melancholy and \u0027\u0027indisposition\u0027\u0027, and unpleasing to themselves\", \"priority\":9}]}, \"synonyms\":{}}");

