	add("indistinction", "{\"term\":\"indistinction\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"First attested in 1624; formed as {{prefix|in|distinction|lang\u003den}}, after \u0027indistinct\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The fact of not distinguishing or making distinctions; failure to perceive or make a difference\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The condition or fact of not being distinct or different; absence of distinguishing qualities or characteristics; undistinguishableness\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Indistinctness, obscurity, dimness\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Absence of distinction or eminence; obscurity\", \"priority\":4}]}, \"synonyms\":{}}");

	add("indistinguishability", "{\"term\":\"indistinguishability\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being indistinguishabl\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1991\u0027\u0027 Earl H. Tilford Jnr. - Setup: what the Air Force did in Vietnam and wh\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"At times Air Force and CAS efforts blended to the point of \u0027\u0027indistinguishability\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027 Bose-Einstein Condensation: An Introductio\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"But due to the \u0027\u0027indistinguishability\u0027\u0027 of the particles in the sample, it describes a decay mechanism that occurs for all N atoms simultaneously\", \"priority\":5}]}, \"synonyms\":{}}");

	add("individuability", "{\"term\":\"individuability\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|individuable|ity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Ability to be individuated; property of being individuable\", \"priority\":1}]}, \"synonyms\":{}}");

	add("individual", "{\"term\":\"individual\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From \u0027individualis\u0027 from Latin \u0027individuum\u0027 (an indivisible thing) neuter of \u0027individuus\u0027 () from \u0027in\u0027 + \u0027dividuus\u0027 () from \u0027lang\u003dla|divido\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person considered alone, rather than as belonging to a group of people\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A single physical human being as a legal subject, as opposed to a legal person such as a corporation\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1982\u0027\u0027, \u0027Canadian Charter of Rights and Freedoms\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Every \u0027\u0027individual\u0027\u0027 is equal before and under the law and has the right to the equal protection and equal benefit of the law without discrimination\u0026amp;nbsp;[\u0026amp;hellip\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An object, be it a thing or an agent, as contrasted to a class\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dIn plants, the ability to recognize self from nonself plays an important role in fertilization, because self-fertilization will result in less diverse offspring than fertilization with pollen from another \u0027\u0027individual\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An element belonging to a population\", \"priority\":7}]}, \"synonyms\":{}}");

	add("individuum", "{\"term\":\"individuum\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|indīviduum}}, noun use of neuter singular of {{m|la|indīviduus||indivisible}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An indivisible entity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A single individual person or thing\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"II.12\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"it seemeth unlikely, that God hath framed this peece of worke alone without a fellow; and that the matter of this forme hath wholly beene spent in this only \u0027\u0027\u0027Individuum\", \"priority\":4}]}, \"synonyms\":{}}");

