	add("indochina", "{\"term\":\"indochina\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From {{prefix|Indo|China|lang\u003den}}, modelled after French \u0027indochine\u0027 Name first proposed in early 19. century by Scottish poet and orientalist John Leyden\u0026lt;ref\u0026gt;http://www.etymonline.com/index.php?allowed_in_frame\u003d0\u0026amp;search\u003dIndochina\u0026amp;searchmode\u003dnone\u0026lt;/ref\u0026gt; and later first used in \u0027Précis de Géographie universelle\u0027 by Conrad Malte-Brun.\u0026lt;ref\u0026gt;http://www.anai-asso.org/NET/document/indochine/index.htm\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The former French colonial part of Southeast Asia comprising the peninsula containing Vietnam, Cambodia and Laos\", \"priority\":1}]}, \"synonyms\":{}}");

