	add("indolence", "{\"term\":\"indolence\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027indolence\u0027 from Latin \u0027indolentia\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Habitual laziness or sloth\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1814\u0027\u0027, w:Jane Jane Austen, \u0027Mansfield Park\u0027, ch. 11\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;It is \u0027\u0027indolence\u0027\u0027, Mr. Bertram, indeed. \u0027\u0027Indolence\u0027\u0027 and love of ease; a want of all laudable ambition, of taste for good company, or of inclination to take the trouble of being agreeable, which make men clergymen.\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1912\u0027\u0027, w:Stewart Edward Stewart Edward White, \u0027The Sign at Six\u0027, ch. 19\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"H]er whole figure expressed a tense vibrant life in singular contrast to the apparent \u0027\u0027indolence\u0027\u0027 of the men at whom she was talking\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027 Sept. 10, w:Garrison Garrison Keillor, \u0026quot;[http://content.time.com/time/magazine/article/0,9171,1000727,00.html In Praise of Lasiness],\u0026quot; \u0027Time\u0027 \u0026lt;small\u0026gt;(retrieved 24 March 2014)\u0026lt;/small\u0026gt\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"N]ow, after five weeks of doing nothing, I am an authority on the subject of \u0027\u0027indolence\u0027\u0027 and glad to share my views with you\", \"priority\":7}]}, \"synonyms\":{}}");

