	add("indomethacin", "{\"term\":\"indomethacin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A non-steroidal anti-inflammatory drug commonly used to reduce fever, pain, stiffness, and swelling, having chemical formula C\u0026lt;sub\u0026gt;19\u0026lt;/sub\u0026gt;H\u0026lt;sub\u0026gt;16\u0026lt;/sub\u0026gt;ClNO\u0026lt;sub\u0026gt;4\u0026lt;/sub\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("indomitability", "{\"term\":\"indomitability\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being indomitable\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Robert Parker: I love Joan\u0027s \u0027\u0027indomitability\u0027\u0027 and intelligence. She\u0027s very courageous. And she\u0027s a hell of a kisser. www.brainyquote.com\", \"priority\":2}]}, \"synonyms\":{}}");

	add("indri", "{\"term\":\"indri\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Malagasy\"], \"text\":\"From Malagasy \u0027endira\u0027 (the lemur \u0027indri indri\u0027) A common myth asserts that the name comes from the word \u0027indry\u0027 ({{IPAchar|ˈiɳɖʐʲ}}) “look! there!” which guides shouted to {{w|Pierre Sonnerat}} upon seeing the animal, and which the French naturalist mistook for its name, but Sonnerat studied indris too closely for this story to be plausible.\u0026lt;ref\u0026gt;I. Hacking, \u0027Was there ever a radical mistranslation?\u0027 (1981), in \u0027Analysis\u0027\u0026lt;/ref\u0026gt;\u0026lt;ref\u0026gt;Alexander R. Dunkel et al., \u0027Giant rabbits, marmosets, and British comedies: etymology of lemur names\u0027, part 1, in \u0027Lemur News\u0027, volume 16 (2011-2012), page 67\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of the largest living lemurs\", \"priority\":1}]}, \"synonyms\":{}}");

