	add("inducement", "{\"term\":\"inducement\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An incentive that helps bring about a desired state\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Citation of Richard Stallman \u0027...it won\u0027t run on a free platform and (...) your program is actually an \u0027\u0027inducement\u0027\u0027 for people to install non-free software.\u0027\u0026lt;ref\u0026gt;Richard Stallman\u0027s speech in Australian National University on 13 October 2004, Part 2, as seen in [http://video.google.com/videoplay?docid\u003d-1647626314188526128\u0026amp;q\u003dlinux+site%3Avideo.google.com\u0026amp;total\u003d44\u0026amp;start\u003d0\u0026amp;num\u003d10\u0026amp;so\u003d0\u0026amp;type\u003dsearch\u0026amp;plindex\u003d7 this film] on video.google.com, circa 40% into the movie. Stallman was talking about Java and flash as inducements for installing non-free software.\u0026lt;/ref\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An introductory statement of facts or background information\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The act of placing a port on a vessel\u0027s itinerary because the volume of cargo offered at that port justifies the cost of routing the vessel\", \"priority\":4}]}, \"synonyms\":{}}");

	add("induction", "{\"term\":\"induction\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027induction\u0027 from Latin \u0027inductiō\u0027 from \u0027indūcō\u0027 (i lead)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An act of inducting\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Beaumont and Fletche\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I know not you; nor am I well pleased to make this time, as the affair now stands, the \u0027\u0027induction\u0027\u0027 of your acquaintance\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"These promises are fair, the parties sure, / And our \u0027\u0027induction\u0027\u0027 full of prosperous hope\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A formal ceremony in which a person is appointed to an office or into military service\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An act of inducing\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Generation of an electric current by a varying magnetic field\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Derivation of general principles from specific instances\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A method of proof of a theorem by first proving it for a specific case (often an integer; usually 0 or 1) and showing that, if it is true for one case then it must be true for the next\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Use of rumors to twist and complicate the plot of a play or to narrate in a way that does not have to state truth nor fact within the play\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"In developmental biology, the development of a feature from part of a formerly homogenous field of cells in response to a morphogen whose source determines the feature\u0027s position and extent\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The process of inducing the birth process\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"An introduction\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Massinge\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"This is but an \u0027\u0027induction\u0027\u0027: I will daw / The curtains of the tragedy hereafter\", \"priority\":16}]}, \"synonyms\":{}}");

	add("inductivism", "{\"term\":\"inductivism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|inductive|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The of developing theories and systems by generalising from meticulously analysed data (\u0027i.e.\u0027, by\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1958–1960\u0027\u0027, w:Richard Stanley R.S. Peters, \u0027The Concept of Motivation\u0027 (2nd ed.), ch. i, page 2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Systems of psychology…developed, which were products of what Popper calls ‘\u0027\u0027inductivism\u0027\u0027’ — attempts to build up generalisations on the basis of carefully scrutinized data\", \"priority\":3}]}, \"synonyms\":{}}");

	add("indulgence", "{\"term\":\"indulgence\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027indulgence\u0027 or its source, Latin \u0027indulgentia\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the act of indulgin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Hammon\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"They err, that through \u0027\u0027indulgence\u0027\u0027 to others, or fondness to any sin in themselves, substitute for repentance anything less\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"toleranc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"catering to someone\u0027s every desir\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"something in which someone indulge\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An indulgent act; favour granted; gratification\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Roger\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"If all these gracious \u0027\u0027indulgences\u0027\u0027 are without any effect on us, we must perish in our own folly\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A pardon or release from the expectation of punishment in purgatory, after the sinner has been granted absolution\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, \u0027A History of Christianity\u0027, Penguin 2010, p. 555\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"To understand how \u0027\u0027indulgences\u0027\u0027 were intended to work depends on linking together a number of assumptions about sin and the afterlife, each of which individually makes considerable sense\", \"priority\":12}]}, \"synonyms\":{}}");

	add("induna", "{\"term\":\"induna\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Zulu\"], \"text\":\"From Zulu \u0027induna\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A South African tribal councillor or headman (under the king); someone in authority, a boss\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Nelson Mandela, \u0027Long Walk to Freedom\u0027, Abacus 2010, p. 75\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Although we swore this fellow to secrecy, he went straight to the \u0027\u0027\u0027induna\u0027\u0027\u0027 and revealed our secret\", \"priority\":3}]}, \"synonyms\":{}}");

	add("induration", "{\"term\":\"induration\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027induracion\u0027 (hardness, obstinacy) from \u0027induratiō\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Hardness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1980.\u0027\u0027 Anthony Burgess, \u0027Earthly Powers\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The voice was harder than I had known, and not only in stony reaction to long floods of wholly just selfpity, also roughened with gin and smoke, perhaps also assimilated to New York \u0027\u0027induration\u0027\u0027, the hardness of culture as well as of pain\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Process of becoming hard\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Hardening of an area of the body as a reaction to inflammation, hyperemia, or neoplastic infiltration\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An area or part of the body that has undergone such a reaction. Most often this term is used to describe dermatologic findings\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2005.\u0027\u0027 Kimura, et al. \u0026quot;Comparison of erythema and \u0027\u0027induration\u0027\u0027 as results of tuberculin tests.\u0027 \u0027Int J Tuberc Lung Dis.\u0027 2005;9(8):853-7. PMID 16104630\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Both erythema and \u0027\u0027induration\u0027\u0027 appear to be adequate indices of tuberculin sensitivity\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2005.\u0027\u0027 Race, et al. [http://www.pubmedcentral.nih.gov/picrender.fcgi?artid\u003d1255951\u0026amp;blobtype\u003dpdf \u0026quot;Painful nodule with induration and spreading erythema.\u0026quot;] \u0027Baylor University Medical Center Proceedings.\u0027 2005;18(4):401–404\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The erythema had spread to 20 cm, and the central \u0027\u0027induration\u0027\u0027 had spread to 9 cm\", \"priority\":10}]}, \"synonyms\":{}}");

	add("industrialist", "{\"term\":\"industrialist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|industrial|ist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person involved in the ownership or management of an industrial enterprise\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Douglas Pratt, \u0027Doug Pratt\u0027s DVD\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Brian Donlevy is a wealthy \u0027\u0027industrialist\u0027\u0027 who survives an attempted murder when his wife\u0027s boyfriend is killed in a car crash\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"One who performs or enjoys industrial music\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, S. Alexander Reed, \u0027Assimilate: A Critical History of Industrial Music\u0027 (page 174\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Like a lot of second-wave \u0027\u0027industrialists\u0027\u0027, Skinny Puppy\u0027s attraction to rhythm wasn\u0027t consciously political, but based in the pleasure of making and moving to a beat; Key was, after all, a drummer\", \"priority\":6}]}, \"synonyms\":{}}");

