	add("industry", "{\"term\":\"industry\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"old french (842-ca. 1400)\", \"old high german (ca. 750-1050)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027lang\u003dfro\u0027 from Latin \u0027lang\u003dla|industria\u0027 () from \u0027lang\u003dla|industrius\u0027 () from Old Latin \u0027indostruus\u0027 (diligent, active) origin unknown. Perhaps from \u0027indu\u0027 (in) + \u0027\u0027 (ūst-, ūstr-) stem of \u0027ūrō\u0027 (pos\u003dverb) related to Old high german (ca. 750-1050) {{m|goh|ūstrī||industry}}, Old english (ca. 450-1100) \u0027andūstrian\u0027 (to hate, detest)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The tendency to work persistently\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Businesses of the same type, considered as a whole\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Christoper Zara, \u0027Tortured Artists: From Picasso and Monroe to Warhol and Winehouse, the Twisted Secrets of the World\u0027s Most Creative Minds\u0027, part 1, chapter 2\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Long before popular music evolved its many genres and subgenres, the \u0027\u0027industry\u0027\u0027 was driven by a simple one-size-fits-all philosophy uncomplicated by impassioned debates over the origins of trip hop or the difference between deatchore and screamo\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/finance-and-economics/21578670-peer-peer-lending-needs-new-name-end-peer-show End of the peer passage\u003dFinance is seldom romantic. But the idea of peer-to-peer lending comes close. This is an \u0027\u0027industry\u0027\u0027 that brings together individual savers and lenders on online platforms. Those that want to borrow are matched with those that want to lend\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Businesses that produce goods as opposed to services\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL4103950W Internal chapter\u003d2|passage\u003dBut through the oligopoly, charcoal fuel proliferated throughout London\u0027s trades and \u0027\u0027industries\u0027\u0027.\u0026amp;nbsp; By the 1200s, brewers and bakers, tilemakers, glassblowers, pottery producers, and a range of other craftsmen all became hour-to-hour consumers of charcoal\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The sector of the economy consisting of large-scale enterprises\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/http://www.economist.com/news/asia/21582043-villagers-enjoy-sunlight-after-dark-out-gloom Out of the passage\u003d[Rural solar plant] schemes are of little help to \u0027\u0027industry\u0027\u0027 or other heavy users of electricity. Nor is solar power yet as cheap as the grid. For all that, the rapid arrival of electric light to Indian villages is long overdue. When the national grid suffers its next huge outage, as it did in July 2012 when hundreds of millions were left in the dark, look for specks of light in the villages\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Automated production of material title\u003d[http://eupat.ffii.org/papers/europarl0309/ Europarl 2003-09-24: Amended Software Patent date\u003d2003-09-24}}\u0026lt;/ref\u0026gt\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"page\u003d122\", \"priority\":11}]}, \"synonyms\":{}}");

